import React, { Component } from 'react';
import {Card,Table} from 'react-bootstrap';
import ViewUserRepos from './Component/viewUserRepos'
import  { Redirect } from 'react-router-dom'

class viewUserDetail extends Component {
  render(){
    return(
      <div>
        <button>kk</button>
        <btnBack />
      </div>
    )
  }
}
    
class btnBack extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Active : false
    };
    this.activeBack = this.activeBack.bind(this);
  }
  render(){
    return(
      <div>
        
        {(this.state.selectUser)?
            <Redirect to={{pathname: '/searchUser'}}
            /> 
            :""
        }  
        <div class="form-row mt-3">
          <div class="form-group col-12">
          <button type="button" className="btn btn-primary" onClick={() => {this.setState({Active:true})}}>Detail</button>                              
          </div>
        </div>
      </div>  
    );
  }
}
export default viewUserDetail
